measurements.description:
Ten flowers and one bud on one arching 90cm inflorescence;
	sepals and petals white overlaid with cherry blossom pink, lightly veined centrally and distally with darker cherry blossom pink;
	lip side lobes and midlobe cherry blossom pink, ocher yellow centrally with maroon spots basally, calli ochre yellow dotted with maroon;
	column white overlaid with cherry blossom pink; substance very firm; texture crystalline.
